import "./App.css";
import Hero from "./Hero/Hero";
import Sidemenu from "./Sidemenu/Sidemenu";
import Footer from "./Footer/Footer";
import About from "./Content/About";

function App() {
  return (
    <div className="container">
      <Hero />
      <div className="main">
        <div className="side-menu">
          <Sidemenu />
        </div>
        <div className="content">
          <About />
        </div>
      </div>
      <Footer />
    </div>
  );
}

export default App;
